import React from 'react';

class Car extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            brand: "Ford",
            model: "Mustang",
            color: "red",
            year: 1964
        }
    }

    changeModel = () => {
        this.setState({model: 'Mercedes'});
    }

    render() {
        return <h2>I'm a { this.state.model } </h2>;
    }
}

export default Car;
